const registros = $('Linhas').first().json.linhas;
let linhaAtual = $('Linha Atual').first().json.linha_atual;

let indice_linha = linhaAtual;

const fieldNames = [
    'INDEX_LINHA',
    'DOCUMENTO',
    'NOME',
    'TELEFONE',
    'EMAIL',
    'NUM_CONTRATO',
    'E_IDEAL',
    'INATIVO',
    'E_FIDC',
    'DIAS_VENCIDO',
    'NUFIN',
    'VENCIMENTOS',
    'VALOR',
    'SUM_VALOR',
    'MSG_ENVIADA',
    'EMAIL_ENVIADO',
    'LIGACAO',
    'DATA_ENVIO',
    'DATA_EMAIL',
    'DATA_LIGACAO',
    'LOG_ENVIO',
    'DATA_ATUALIZACAO',
    'ARQUIVO',
    'IMAGEM'
];

const fieldSchema = {
    'INDEX_LINHA': {type: 'INTEGER', mode: 'REQUIRED'},
    'DOCUMENTO': {type: 'STRING', mode: 'REQUIRED'},
    'NOME': {type: 'STRING', mode: 'REQUIRED'},
    'TELEFONE': {type: 'STRING', mode: 'REQUIRED'},
    'EMAIL': {type: 'STRING', mode: 'REQUIRED'},
    'NUM_CONTRATO': {type: 'STRING', mode: 'REQUIRED'},
    'E_IDEAL': {type: 'INTEGER', mode: 'REQUIRED'},
    'INATIVO': {type: 'INTEGER', mode: 'NULLABLE'},
    'E_FIDC': {type: 'INTEGER', mode: 'NULLABLE'},
    'DIAS_VENCIDO': {type: 'INTEGER', mode: 'REQUIRED'},
    'NUFIN': {type: 'STRING', mode: 'REQUIRED'},
    'VENCIMENTOS': {type: 'STRING', mode: 'NULLABLE'},
    'VALOR': {type: 'STRING', mode: 'REQUIRED'},
    'SUM_VALOR': {type: 'FLOAT', mode: 'REQUIRED'},
    'MSG_ENVIADA': {type: 'STRING', mode: 'REQUIRED'},
    'EMAIL_ENVIADO': {type: 'BOOLEAN', mode: 'NULLABLE'},
    'LIGACAO': {type: 'BOOLEAN', mode: 'NULLABLE'},
    'DATA_ENVIO': {type: 'DATETIME', mode: 'NULLABLE'},
    'DATA_EMAIL': {type: 'DATETIME', mode: 'NULLABLE'},
    'DATA_LIGACAO': {type: 'DATETIME', mode: 'NULLABLE'},
    'LOG_ENVIO': {type: 'STRING', mode: 'NULLABLE'},
    'DATA_ATUALIZACAO': {type: 'DATETIME', mode: 'NULLABLE'},
    'ARQUIVO': {type: 'BOOLEAN', mode: 'NULLABLE'},
    'IMAGEM': {type: 'BOOLEAN', mode: 'NULLABLE'}
};

let valuesClauses = [];

for (let registro of registros) {
    indice_linha++;
    registro['INDEX_LINHA'] = indice_linha;

    let values = [];
    for (let fieldName of fieldNames) {
        let fieldInfo = fieldSchema[fieldName];
        let value = registro[fieldName];

        if (value === undefined || value === null || value === '') {
            if (fieldInfo.mode === 'NULLABLE') {
                values.push('NULL');
            } else {
                // Campo obrigatório sem valor
                throw new Error(`O campo obrigatório ${fieldName} está ausente em um registro.`);
            }
        } else {
            // Formatando o valor de acordo com o tipo
            let formattedValue;
            switch (fieldInfo.type) {
                case 'STRING':
                    // Escapar aspas simples
                    formattedValue = `'${value.replace(/'/g, "\\'")}'`;
                    break;
                case 'INTEGER':
                case 'FLOAT':
                    formattedValue = value;
                    break;
                case 'BOOLEAN':
                    formattedValue = value ? 'true' : 'false';
                    break;
                case 'DATETIME':
                    // Certifique-se de que o valor esteja no formato 'YYYY-MM-DD HH:MM:SS'
                    formattedValue = `'${value}'`;
                    break;
                default:
                    formattedValue = `'${value}'`; // Padrão para string
            }
            values.push(formattedValue);
        }
    }
    let valuesString = `(${values.join(',')})`;
    valuesClauses.push(valuesString);
}

// Substitua 'seu_dataset.sua_tabela' pelo nome real do seu dataset e tabela
const tableName = '`blips-bigdata.IA_E_AUTOMACAO.DADOS_COBRANCA_ESPERANZA`';

const insertStatement = `INSERT INTO ${tableName} (${fieldNames.join(',')}) VALUES ${valuesClauses.join(',')};`;

return [
    {
        json: {
            insertStatement: insertStatement,
            linhaAtual: indice_linha
        }
    }
];

const novoNumero = {
  linha_atual: $('Gera Insert').first().json.linhaAtual
}
const data = JSON.stringify(novoNumero); // Serializa os dados JSON em string

return [
    {
        json: {
            novoArquivo: Buffer.from(data, 'utf-8').toString('base64')
        }
    }
];
